<table width="300" bgcolor="#cccccc" border="0" cellspacing="1" cellpadding="8">
    <tr>
      <td bgcolor="#f3f3f3"><font size="-1" color="#333333"><b>商品説明</b></font></td>
    </tr>
    <tr>
      <td bgcolor="#ffffff"><font size="-1" color="#333333">
ストライプのカットがかわいいグラスはおうちカフェに使いたくなるデザインです。スタッキングが可能で収納も安心。こちらは約270ccサイズでアイスコーヒーやジュース、お水など様々なアイスドリンクが楽しめます。耐熱製のため約120℃の温度差に耐える事ができます。食洗機OKです！</font></td>
    </tr>
    <tr>
      <td bgcolor="#f3f3f3"><font size="-1" color="#333333"><b>商品詳細</b></font></td>
    </tr>
    <tr>
      <td bgcolor="#ffffff">
      <font size="-1" color="#333333">
      サイズ／口径7×高さ11.2cm<br>
      重さ／約229g（商品により誤差があります。）<br>
      容量／約270cc（満水）<br>
        素材／ガラス（全面物理強化ガラス）　 <br>
        質感／つややか<br>
        生産地／フランス製・中国製<br>
        <br>
        電子レンジ、食器洗い機使用可<br>
取り寄せ可能<br>
      <br>
        ※サイズは全て外寸になります。<br>
        ※不明な点がございましたら、お気軽にお問い合わせ下さい。</font></td>
    </tr>
    <tr>
      <td bgcolor="#f3f3f3"><font size="-1" color="#333333"><b>ご注意</b></font></td>
    </tr>
    <tr>
      <td bgcolor="#ffffff"><font size="-1" color="#333333">※食器の内面に小さな傷や気泡が見られる場合がございます。ガラス製品の特徴としてご理解くださいませ。<br>
        <br>
      ※また加熱した全面物理強化ガラスに急に冷水を入れたり、濡らした布などの上や冷えた作業台なども含めた台の上に置いたりしないでください。破損の原因になります。<br>
      <br>
※ガラス製品は中性洗剤などで洗ってください。その際ガラスを傷つけるおそれのある研磨剤入のスポンジ、金属たわし、クレンザー等特殊洗剤を使用しますと破損の原因となりますのでご使用を避けてください。<BR>
